webpackJsonp([99532679401412],{4968:function(e,t){e.exports={data:{post:{html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/1999/12/snow.jpg" height="300" width="400" border="0" alt="snow.jpg: Snow in LÃ¼llau 19 Dec 1999" /></p>\n<p>This is the view from our living room this morning. Our backyard only extends to the fence; the horse pasture isn\'t ours, it\'s just part of our view.</p>\n<p>I seem to have caught a cold, and I have a pounding headache. I\'m glad I didn\'t have to go outside for these pictures! Even zooming in on the horses through the window seems to have worked out.</p>\n<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/1999/12/snowhorses.jpg" height="300" width="400" border="0" alt="snowhorses.jpg: Horses in the snow" /></p>\n<p>Even my PC seems to be under the weather. My 128 MB RAM chip sputtered out around 12:30 am Saturday morning, so I only have 64 MB left. It\'s feeling somewhat underpowered, even just using Netscape under Linux starts swapping to disk.</p>',fields:{title:"Under the weather",date:"19 Dec 1999",url:"https://papascott.de/1999-12-19-under-the-weather/"}}},pathContext:{slug:"/1999-12-19-under-the-weather/",prev:{fields:{title:"Feet",date:"15 Dec 1999",slug:"/1999-12-15-feet/"}},next:{fields:{title:"Where we are...",date:"20 Dec 1999",slug:"/1999-12-20-where-we-are/"}}}}}});
